<script type="text/javascript">

$(function(){
$('#next, #prev').css("display","none");
$('.startimg').delay(3000).fadeOut(1000,function(){
$('#startimages').show();
$('#nav_boxes').show();
$('#startimages img:first').fadeIn(400, function() {
$('#startimages').cycle({
fx: 'fade',
before: function(e1,e2){
$(e2).show();
$(e1).show();
title = e2.title;
titles = title.split("|");
if (titles.length==3){
title = "<h2>"+titles[0]+"</h2> <h1>"+titles[2]+"</h1>";
$("#titlebox").attr("title",titles[1]);
}
$("#titletext").html(title);

//alert(e2.title);
},
after: function(e1,e2){

},
pager: '#nav',
timeout: 4000
});
});
})

$('#startimages, #next, #prev').hover(function(){
$('#next, #prev').css("display","");
},function(){
$('#next, #prev').css("display","none");
});


var link = location.href.split('/');
link = link[link.length-1];
//alert(link);
$('#menu A[href*="'+link+'"]').addClass('selected');


$("#leftbox").hover(function(){
$("#realizacjaprev2").stop(true,true).fadeIn(300);
},function(){
$("#realizacjaprev2").stop(true,true).fadeOut(300);
}).click(function(){
$('#startimages').cycle('prev');
});

$("#rightbox").hover(function(){
//$(this).children("IMG").attr("src",$(this).children("IMG").attr("src").replace("1.png","2.png"));
$("#realizacjanext2").stop(true,true).fadeIn(300);
},function(){
//$(this).children("IMG").attr("src",$(this).children("IMG").attr("src").replace("2.png","1.png"));
$("#realizacjanext2").stop(true,true).fadeOut(300);
}).click(function(){
$('#startimages').cycle('next');
});

$("#titlebox").hover(function(){
$("#titlebox_bg").stop().animate({
opacity: 1
},300);
//$("#titlebox_bg").removeClass("titlebox_bgactive");
},function(){
$("#titlebox_bg").stop().animate({
opacity: 0.4
},300);
//$("#titlebox_bg").addClass("titlebox_bgactive");
});

$("#titlebox").click(function(){
if (this.title!="")
location.href=this.title;
});



});

</script>
