<script type="text/javascript">


function parseHash() {
hash = window.location.hash;
return parseInt(hash.substring(6)) || 1;
}

function resolvenextprev(inc){
ile = $(".tabs").length;
//alert(parseHash()+" "+ile);
if (parseHash()+inc>=ile){
$("#nextp").css("display","none");
$("#nextpd").css("display","");
}else{
$("#nextp").css("display","");
$("#nextpd").css("display","none");
}

if (parseHash()+inc<=1){
$("#prevp").css("display","none");
$("#prevpd").css("display","");
}else{
$("#prevp").css("display","");
$("#prevpd").css("display","none");
}

}



$(function(){


$(".projektdiv").hover(function(){
$(this).children(".projektimg").stop();
$(this).children(".projektimg").animate({opacity: 0.0});
},function(){
$(this).children(".projektimg").stop();
$(this).children(".projektimg").animate({opacity: 1.0});
});

$(".xprojekt").mouseout(function(){
$(".projektimg").css("display","");
$(".projekt").css("display","none");
$(this).css("display","none").parent().children("#projektimg").css("display","");
});
$(".xprojektimg").mouseover(function(){
//$(".projekt").css("display","none");
$(this).fadeOut(500);
//$(this).css("display","none").parent().children("#projekt").css("display","");
$(this).css("display","none").parent().children("#projekt").fadeIn(500);
});

var scrollwidth = 846

$("#prevp").click(function(){
if (parseHash()-1>0)
this.href = "Realizacje#page="+(parseHash()-1);
$("#all").animate({
scrollLeft: $("#all").scrollLeft()-scrollwidth
}, 800);
resolvenextprev(-1);
});

$("#nextp").click(function(){
ile = $(".tabs").length;
if (parseHash()+1<=ile)
this.href = "Realizacje#page="+(parseHash()+1);
$("#all").animate({
scrollLeft: $("#all").scrollLeft()+scrollwidth
}, 800);

resolvenextprev(1);


});

$("#all").animate({
scrollLeft: $("#all").scrollLeft()+scrollwidth*(parseHash()-1)
}, 100);
resolvenextprev(0);


$('#frame').fadeIn(1500);

});


</script>
